import{_ as o}from"./chunks/log_download.DNJj99t9.js";import{_ as t,c as a,a8 as i,o as r}from"./chunks/framework.BDnHobkS.js";const u=JSON.parse('{"title":"Flight Reporting","description":"","frontmatter":{},"headers":[],"relativePath":"en/getting_started/flight_reporting.md","filePath":"en/getting_started/flight_reporting.md"}'),l={name:"en/getting_started/flight_reporting.md"};function n(s,e,g,h,c,d){return r(),a("div",null,e[0]||(e[0]=[i('<h1 id="flight-reporting" tabindex="-1">Flight Reporting <a class="header-anchor" href="#flight-reporting" aria-label="Permalink to &quot;Flight Reporting&quot;">​</a></h1><p>PX4 logs detailed aircraft state and sensor data, which can be used to analyze performance issues. This topic explains how you can download and analyse logs, and share them with the development team for review.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Keeping flight logs is a legal requirement in some jurisdictions.</p></div><h2 id="downloading-logs-from-the-flight-controller" tabindex="-1">Downloading Logs from the Flight Controller <a class="header-anchor" href="#downloading-logs-from-the-flight-controller" aria-label="Permalink to &quot;Downloading Logs from the Flight Controller&quot;">​</a></h2><p>Logs can be downloaded using <a href="http://qgroundcontrol.com/" target="_blank" rel="noreferrer">QGroundControl</a>: <strong><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/analyze_view/log_download.html" target="_blank" rel="noreferrer">Analyze View &gt; Log Download</a></strong>.</p><p><img src="'+o+'" alt="Flight Log Download"></p><h2 id="analyzing-the-logs" tabindex="-1">Analyzing the Logs <a class="header-anchor" href="#analyzing-the-logs" aria-label="Permalink to &quot;Analyzing the Logs&quot;">​</a></h2><p>Upload the log file to the online <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> tool. After upload you&#39;ll be emailed a link to the analysis page for the log.</p><p><a href="./../log/flight_review.html">Log Analysis using Flight Review</a> explains how to interpret the plots, and can help you to verify/reject the causes of common problems: excessive vibration, poor PID tuning, saturated controllers, imbalanced vehicles, GPS noise, etc.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>There are many other great tools for visualising and analysing PX4 Logs. For more information see: <a href="./../dev_log/flight_log_analysis.html">Flight Analysis</a>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If you have a constant high-rate MAVLink connection to the vehicle (not just a telemetry link) then you can use <em>QGroundControl</em> to automatically upload logs directly to <em>Flight Review</em>. For more information see <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/settings_view/mavlink.html#logging" target="_blank" rel="noreferrer">Settings &gt; MAVLink Settings &gt; MAVLink 2 Logging (PX4 only)</a>.</p></div><h2 id="sharing-the-log-files-for-review-by-px4-developers" tabindex="-1">Sharing the Log Files for Review by PX4 Developers <a class="header-anchor" href="#sharing-the-log-files-for-review-by-px4-developers" aria-label="Permalink to &quot;Sharing the Log Files for Review by PX4 Developers&quot;">​</a></h2><p>The <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> log file link can be shared for discussion in the <a href="./../contribute/support.html#forums-and-chat">support forums</a> or a <a href="./../#reporting-bugs-issues">Github issue</a>.</p><h2 id="log-configuration" tabindex="-1">Log Configuration <a class="header-anchor" href="#log-configuration" aria-label="Permalink to &quot;Log Configuration&quot;">​</a></h2><p>The logging system is configured by default to collect sensible logs for use with <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a>.</p><p>Logging may further be configured using the <a href="./../advanced_config/parameter_reference.html#sd-logging">SD Logging</a> parameters or with a file on the SD card. Details on configuration can be found in the <a href="./../dev_log/logging.html#configuration">logging configuration documentation</a>.</p><h2 id="key-links" tabindex="-1">Key Links <a class="header-anchor" href="#key-links" aria-label="Permalink to &quot;Key Links&quot;">​</a></h2><ul><li><a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a></li><li><a href="./../log/flight_review.html">Log Analysis using Flight Review</a></li><li><a href="./../dev_log/flight_log_analysis.html">Flight Log Analysis</a></li></ul>',18)]))}const m=t(l,[["render",n]]);export{u as __pageData,m as default};
